import './asideInformation.css'

export default function AsideContacts ({title, number, description}){
    return(
        <article className="contacts__article">
            <aside className="contacts__aside">
                <p className="contacts__title">{title}</p>
                <p className="contacts__number">{number}</p>
                <p className="contacts__description">{description}</p>
            </aside>
        </article>
    )
}
